func (afs *AdditionalFeeSelect) Scan(ctx context.Context, v any) error {
	ctx = setContextOp(ctx, afs.ctx, ent.OpQuerySelect)
	if err := afs.prepareQuery(ctx); err != nil {
		return err
	}
	return scanWithInterceptors[*AdditionalFeeQuery, *AdditionalFeeSelect](ctx, afs.AdditionalFeeQuery, afs, afs.inters, v)
}

func (afs *AdditionalFeeSelect) sqlScan(ctx context.Context, root *AdditionalFeeQuery, v any) error {
	selector := root.sqlQuery(ctx)
	aggregation := make([]string, 0, len(afs.fns))
	for _, fn := range afs.fns {
		aggregation = append(aggregation, fn(selector))
	}
	switch n := len(*afs.selector.flds); {
	case n == 0 && len(aggregation) > 0:
		selector.Select(aggregation...)
	case n != 0 && len(aggregation) > 0:
		selector.AppendSelect(aggregation...)
	}
	rows := &sql.Rows{}
	query, args := selector.Query()
	if err := afs.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

// Modify adds a query modifier for attaching custom logic to queries.
func (afs *AdditionalFeeSelect) Modify(modifiers ...func(s *sql.Selector)) *AdditionalFeeSelect {
	afs.modifiers = append(afs.modifiers, modifiers...)
	return afs
}
